function Banner(){
  return(
  <div className="Banner">
    <div>&nbsp;</div>
    <div className="bannerText">
      <div className="bigtext">Let's find your home and an inspector.</div>
      <div className="medtext">
        <div>Check out your home and see what we offer for your <b>Inspection Protection</b>.</div>
        <div>We'll match you with one of our preferred inspectors.</div>
      </div>
    </div>
  </div>
  )
}

export default Banner;
